import { SettingModel } from "./../models/SettingModel";

export const MODES = Object.freeze({
    POMODORO: 0,
    SHORT_BREAK: 1,
    LONG_BREAK: 2
});

export const PAGES = Object.freeze({
    TIMER: 0,
    SETTINGS: 1
});

export const DEFAULTSETTINGS = [
    new SettingModel("hi", "hewwo")
];
